webpackJsonp([0x3fbeb6ef596f120],{"./node_modules/json-loader/index.js!./.cache/json/html-elements-lists.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Lists</h2>\n<p>There are three types of lists in HTML. All lists must contain one or more list elements.</p>\n<h3>Unordered HTML List</h3>\n<p>The unordered list starts with <code>&#x3C;ul></code> tag and list items start with the <code>&#x3C;li></code> tag. In unordered lists all the list items marked with bullets by default.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code><ul>\n  <li>Item</li>\n  <li>Item</li>\n  <li>Item</li>\n</ul></code></pre>\n      </div>\n<p>  Output:</p>\n  <html>\n    <ul>\n    <li>Item</li>\n    <li>Item</li>\n    <li>Item</li>\n  </ul>\n  </html>\n<h3>Ordered HTML List</h3>\n<p>The ordered list starts with <code>&#x3C;ol></code> tag and list items start with the <code>&#x3C;li></code> tag. In ordered lists all the list items are marked with numbers.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code><ol>\n  <li>First Item</li>\n  <li>Second Item</li>\n  <li>Third Item</li>\n</ol></code></pre>\n      </div>\n<p>  Output:</p>\n   <html>\n   <ol>\n    <li>First Item</li>\n    <li>Second Item</li>\n    <li>Third Item</li>\n  </ol>\n</html>\n<h3>HTML Description List</h3>\n<p>The description list contains list items with their definitons. We use <code>&#x3C;dl></code> tag to start list, <code>&#x3C;dt></code> tag to define a term and <code>&#x3C;dd></code> tag to describe each term.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code><dl>\n<dt>freeCodeCamp</dt>\n<dd>Learn to code with free online courses, programming projects, and interview preparation for developer jobs.</dd>\n<dt>GitHub</dt>\n<dd>GitHub is a web-based Git or version control repository and Internet hosting service. It is mostly used for code.</dd>\n</dl></code></pre>\n      </div>\n<p> Output:</p>\n <html>\n   <dl>\n <dt>freeCodeCamp</dt>\n <dd>Learn to code with free online courses, programming projects, and interview preparation for developer jobs.</dd>\n <dt>GitHub</dt>\n <dd>GitHub is a web-based Git or version control repository and Internet hosting service. It is mostly used for code.</dd>\n </dl>\n  </hhtml>\n<h4>More Information:</h4>\n<p><a href="https://html.com/lists/">HTML</a></p>\n<p><a href="https://www.w3schools.com/html/html_lists.asp">w3schools</a></p>',fields:{slug:"/html/elements/lists/"},frontmatter:{title:"Lists"}}},pathContext:{slug:"/html/elements/lists/"}}}});
